(2, 1, '2018-03-20 12:49:26', '2018-03-20 15:49:26', 'Este é o exemplo de uma página. É diferente de um post de blog porque é estática e pode aparecer em menus de navegação (na maioria dos temas). A maioria das pessoas começam com uma página \'Sobre\' que as apresenta aos potenciais visitantes do site. Você pode usar algo como:\r\n<blockquote>Oi! Sou um estudante de Biologia e gosto de esportes e natureza. Nos fins de semana pratico futebol com meus amigos no clube local. Eu moro em Valinhos e fiz este site para falar sobre minha cidade.</blockquote>\r\n...ou algo como:\r\n<blockquote>A empresa Logos foi fundada em 1980, e tem provido o comércio local com o que há de melhor em informatização. Localizada em Recife, nossa empresa tem se destacado como um das que também contribuem para o descarte correto de equipamentos eletrônicos substituídos.</blockquote>\r\nComo um novo usuário WordPress, vá ao seu <a href="http://localhost/cunha_granja/wp-admin/">Painel</a> para excluir este conteúdo e criar o seu. Divirta-se!', 'Home', '', 'publish', 'closed', 'open', '', 'pagina-exemplo', '', '', '2018-03-21 11:57:10', '2018-03-21 14:57:10', '', 0, 'http://localhost/cunha_granja/?page_id=2', 0, 'page', '', 0),
